export const RegisterPharmacy = () => {

    const getLatitudeLongitude = async (address: string) => {
        try {
            const apiKey = process.env.REACT_APP_GOOGLE_MAPS_API_KEY;

            const response = await axios.get<GeocodeResponse>(
              `https://maps.googleapis.com/maps/api/geocode/json?address=${encodeURIComponent(
                address
              )}&key=${apiKey}`
            );
        
            const { results } = response.data;
        
            if (results.length > 0) {
              const { lat, lng } = results[0].geometry.location;
              return { lat, lng };
            } else {
              throw new Error('No results found for the given address.');
            }
          } catch (error) {
            throw new Error(`Error getting latitude and longitude: ${(error as Error).message}`);
          }
    }

    console.log(getLatitudeLongitude('447 Thanon Si Ayutthaya, Thung Phaya Thai, Ratchathewi, Bangkok 10400'));


